INSERT INTO `v1_a00bebf347027fd3291922cde79f675568d5a72e449440153ed7b635919d469d` VALUES (11601, 0.75, 6, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。", 0.625, 1, "ツムギのボトルキャップ");
